import React from 'react';

const libinkle = require('libinkle');
const buf = fs.readFileSync('testStory.json');
const inkle = new libinkle(buf.toString());
inkle.start();
var paragraphList = inkle.getText();

export const Header = () => {

    const headerStyle = {

        width: '100%',
        padding: '2%',
        backgroundColor: "red",
        color: 'white',
        textAlign: 'center'
    }

    return(
        <div style={headerStyle}>
            <h1>{paragraphList}</h1>
        </div>
    )
}
